import React, { useState, useEffect } from 'react';

const fetchPostData = async (endpoint) => {
    try {
        const response = await fetch(endpoint); // Basic GET request with fetch
        if (!response.ok) {
            throw new Error('Network response was not ok');
        }
        const data = await response.json(); // Parse the JSON data
        console.log('Data:', data);
        return data;
    } catch (error) {
        console.error('Error:', error);
    }
};

export default function FullCartView() {
    const [posts, setPosts] = useState([]);
  
    useEffect(() => {
      // Fetch posts when the component mounts
      const fetchData = async () => {
        const data = await fetchPostData('http://localhost:8000/api/posts/latest'); // Replace with your endpoint
        setPosts(data.slice(0, 5)); // Limit to the first 5 posts
      };
      fetchData();
    }, []);
  
    return (
      <div>
        <h1>Latest Posts</h1>
        {posts.length > 0 ? (
          <ul>
            {posts.map((post) => (
              <li key={post.post_id}>
                <strong>Main Topic:</strong> {post.main_topic}, <strong>Question Asked:</strong> {post.question_asked}
              </li>
            ))}
          </ul>
        ) : (
          <p>Loading posts...</p>
        )}
      </div>
    );
}
